// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;

import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

library PriceConverter{
    function getPrice() internal view returns(uint256) {
        // Address 0x694AA1769357215DE4FAC081bf1f309aDC325306
        // ABI
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        (,int256 price,,,) = priceFeed.latestRoundData();
        // Price of ETH un terms of USD
        return uint256(price * 1e10);
    }
    function getConversionRate(uint256 ethAmount) internal view returns (uint256) {
        // Price of 1 ETH?
        // $ 4008_290000000000000000
        uint256 ethPrice = getPrice();
        // (4008_290000000000000000 * 1_000000000000000000) / 1e18
        //Answer of above will add 38 additional zeros. So we must divided by 18 to lower the zeros.
        // $ 4008 = 1 ETH
        // In Solidity, always multiply before you divide.
        // Only whole numbers exist in solidity. Example: 2/5 = 0
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;
        return ethAmountInUsd;
    }

    function getVersion() internal view returns (uint256) {
        return AggregatorV3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306).version();
    }
}

